export const homeObjectOne = {
  id: "about",
  lightBackground: false,
  lightText: true,
  lightTextDesc: true,
  topLine: "Unlimited Possibilities",
  headLine: "Wouldn't you like to",
  description: "Reach your financial goal?",
  buttonLabel: "Discover Moneys",
  imgStart: false,
  img: "/images/investing.svg",
  alt: "car",
  dark: true,
  primary: true,
  darkText: false,
};

export const homeObjectTwo = {
  id: "discover",
  lightBackground: true,
  lightText: false,
  lightTextDesc: false,
  topLine: "So what's Moneys is all about?",
  headLine: "Three simple steps.",
  description: `Create a free account.
   Sign to your bank account through your dashboard.
   Let Moneys algorithm show you how to free up money by telling you what you spend on,
    and how to improve.`,
  buttonLabel: "Discover How",
  imgStart: true,
  img: "/images/savings.svg",
  alt: "PiggyBank",
  dark: false,
  primary: false,
  darkText: true,
};

